    def test_to_favicon_01(self):
        input_filename = os.path.join(cwd, 'sources', 'icon.png')
        favicon_settings = {'input': input_filename}
        df_elf = ImageFileElf()
        df_elf.to_favicon(**favicon_settings)
        icon_sizes = [16, 24, 32, 48, 64, 128, 255]
        for x in icon_sizes:
            filename = 'favicon' + str(x) + '.ico'
            result_filename = os.path.join(cwd, 'result', 'IFE', filename)
            self.assertEqual(df_elf.checksum(df_elf.get_output_path(filename)), df_elf.checksum(result_filename))
        favicon_settings = {
            'input': input_filename,
            'size': 192
        }
        df_elf.to_favicon(**favicon_settings)
        filename = 'favicon192.ico'
        result_filename = os.path.join(cwd, 'result', 'IFE', filename)
        self.assertEqual(df_elf.checksum(df_elf.get_output_path(filename)), df_elf.checksum(result_filename))

