    def test_to_favicon_03(self):
        input_filename = os.path.join(cwd, 'sources', 'icon.png')
        favicon_settings = {'input': input_filename}
        df_elf = ImageFileElf(output_flag=False)
        result = df_elf.to_favicon(silent=True, **favicon_settings)
        icon_sizes = [16, 24, 32, 48, 64, 128, 255]
        i = 0
        for x in icon_sizes:
            filename = 'favicon' + str(x) + '.ico'
            result_filename = os.path.join(cwd, 'result', 'IFE', filename)
            self.assertFalse(os.path.exists(df_elf.get_log_path(filename)))
            with Image.open(result_filename) as img:
                self.assertEqual(None, ImageChops.difference(result[i], img).getbbox())
            i = i + 1

