    def test_base64_01(self):
        df_elf = ImageFileElf()
        input_filename = os.path.join(cwd, 'sources', 'icon.png')
        config = {
            'input': input_filename
        }
        image_data, file_extension = df_elf.to_base64(**config)
        output_filename = 'test_base64_01.png'
        config_02 = {
            'input': image_data,
            'output': output_filename
        }
        df_elf.from_base64(**config_02)
        self.assertEqual(df_elf.checksum(df_elf.get_output_path(output_filename)), df_elf.checksum(input_filename))
        config_03 = {
            'input': input_filename,
            'css_format': True
        }
        encoded, file_extension = df_elf.to_base64(**config_03)
        result_encoded = '"data:image/png;base64,"'
        self.assertEqual(result_encoded, encoded)
        df_elf_01 = ImageFileElf(output_flag=False)
        df_elf_01.from_base64(**config_02)
        self.assertEqual(df_elf_01.checksum(df_elf_01.get_log_path(output_filename)), df_elf_01.checksum(input_filename))

    def test_base64_02(self):
        df_elf = ImageFileElf()
        input_filename = os.path.join(cwd, 'sources', 'icon.png')
        f = open(input_filename, 'rb')
        input_content = f.read()
        f.close()
        image_data, file_extension = df_elf.to_base64(input_content)
        output_filename = 'test_base64_02.png'
        config_02 = {
            'output': output_filename
        }
        df_elf.from_base64(image_data, **config_02)
        self.assertEqual(df_elf.checksum(df_elf.get_output_path(output_filename)), df_elf.checksum(input_filename))
        config_03 = {
            'css_format': True
        }
        encoded, file_extension = df_elf.to_base64(input_content, **config_03)
        result_encoded = '"data:image/png;base64,"'
        self.assertEqual(result_encoded, encoded)
        df_elf_01 = ImageFileElf(output_flag=False)
        df_elf_01.from_base64(image_data, **config_02)
        self.assertEqual(df_elf_01.checksum(df_elf_01.get_log_path(output_filename)), df_elf_01.checksum(input_filename))

